CREATE DATABASE CQ_BI_13_source_system
GO

USE CQ_BI_13_source_system
GO

CREATE TABLE [branch](
	[branch] [nvarchar](255) NULL,
	[city] [nvarchar](255) NULL,
	[created_at] [datetime] NOT NULL,
	[updated_at] [datetime] NOT NULL,
	[is_deleted] [bit] NULL
) ON [PRIMARY]
GO

CREATE TABLE [product](
	[product_id] [nvarchar](255) NULL,
	[unit_price] [float] NULL,
	[product_line] [nvarchar](255) NULL,
	[created_at] [datetime] NOT NULL,
	[updated_at] [datetime] NOT NULL,
	[is_deleted] [bit] NULL
) ON [PRIMARY]
GO

CREATE TABLE [product_line](
	[product_line] [nvarchar](255) NULL,
	[product_line_id] [nvarchar](255) NULL,
	[created_at] [datetime] NOT NULL,
	[updated_at] [datetime] NOT NULL,
	[is_deleted] [bit] NULL
) ON [PRIMARY]
GO

CREATE TABLE [supermarket_sales](
	[invoice_id] [nvarchar](255) NULL,
	[branch] [nvarchar](255) NULL,
	[customer_type] [nvarchar](255) NULL,
	[gender] [nvarchar](255) NULL,
	[product_id] [nvarchar](255) NULL,
	[quantity] [float] NULL,
	[tax_5] [float] NULL,
	[total] [float] NULL,
	[date] [datetime] NULL,
	[time] [datetime] NULL,
	[payment] [nvarchar](255) NULL,
	[cogs] [float] NULL,
	[gross_margin_percentage] [float] NULL,
	[gross_income] [float] NULL,
	[rating] [float] NULL,
	[created_at] [datetime] NOT NULL,
	[updated_at] [datetime] NOT NULL,
	[is_deleted] [bit] NULL
) ON [PRIMARY]
GO
